  false,\n\t\"url\": null,\n\t\"notes\": \"This annual narrative report for the National
  Bison Range outlines Refuge accomplishments for the 1993 calendar year. The report
  begins with an introduction to the Refuge and describes climate and habitat conditions.
  The planning section discusses field research and investigations. Administration
  topics are described, including: personnel, youth programs, volunteer programs,
  funding, safety, and technical assistance. Habitat management is covered; forests,
  wetlands, grasslands, grazing, haying, fire management, pest control, and water
  rights are discussed. The wildlife section of the report discusses wildlife diversity,
  endangered and threatened species, migratory birds, raptors, game mammals, big game
  animals, other resident wildlife, fishery resources, surplus animal disposal, scientific
  collections, and disease prevention and control. Interpretation and recreation activities
  are outlined; topics include information and interpretation, recreational uses,
  and law enforcement. The equipment and facilities section discusses new construction,
  rehabilitation, major maintenance, equipment utilization and replacement, communications
  systems, and energy conservation. Cooperative programs and items of interest are
  discussed.\",\n\t\"owner_org\": \"4d7ad1cd-3641-420b-8116-e4082f49cd44\",\n\t\"extras\":
